Now, let’s implement the logic we need. To the bottom of the power.c file, add the following code (we can start by copying in the prototype from the power.h file): int32_t power_power_of(int32_t base, int32_t exp)
{ int32_t res = 1; for (int32_t i = 0; i < exp; ++i) { res *= base; } return res;
} Now let’s save the file and get back to our command line. We can compile this program into a Wasm module by using the following command. clang \ --target=wasm32-unknown-wasi \ -mexec-model=reactor \ -I. \ -o power.wasm \ power.c You should now see a power.wasm file in your directory. Next, we'll do some testing .

